import React from "react";

const Footer = () => {
  return (
    <footer>
      <div className="row">
        <div className="col"></div>
        <div className="col"></div>
        <div className="col"></div>
        <div className="col"></div>
      </div>
    </footer>
  );
};

export default Footer;
